import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element (div with class 'cart')
    await page.waitForSelector('div.cart', { timeout: 5000 });

    // Click on the cart to open the shopping cart modal
    await page.click('div.cart');

    // Wait for the cart modal to appear (div#cartModal or .modal with cart content)
    // Try both possible selectors
    let cartModalSelector = 'div#cartModal';
    let cartModalVisible = false;
    try {
      await page.waitForSelector('div#cartModal', { timeout: 2500 });
      cartModalVisible = await page.isVisible('div#cartModal');
    } catch {
      // fallback to .modal
      await page.waitForSelector('.modal', { timeout: 2500 });
      cartModalSelector = '.modal';
      cartModalVisible = await page.isVisible('.modal');
    }

    // Take screenshot after opening cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_opened.png'));

    // Extract cart modal title and number of cart items (if present)
    let cartTitle = null;
    let cartItemsCount = null;
    if (cartModalVisible) {
      cartTitle = await page.$eval(`${cartModalSelector} h2`, el => el.textContent.trim()).catch(() => null);
      // Try to count .cart-item elements inside the modal
      cartItemsCount = await page.$$eval(`${cartModalSelector} .cart-item`, els => els.length).catch(() => null);
      // If no items, check for empty cart message
      if (cartItemsCount === 0) {
        const emptyCartText = await page.$eval(`${cartModalSelector}`, el => el.textContent).catch(() => '');
        if (emptyCartText && emptyCartText.toLowerCase().includes('your cart is empty')) {
          cartItemsCount = 0;
        }
      }
    }

    return {
      success: true,
      action: "Opened the shopping cart modal and verified its appearance",
      extractedData: {
        cartModalTitle: cartTitle,
        cartItemsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
